import styled from 'styled-components'


export const DivNavStyled = styled.div`
    background-color:rgb(1,255,78) ;
    width:100vw;
    /* color:red */

    a{
        text-decoration: none;
        color:${props => props.fontColor};

        &:hover{
            text-decoration: none;
            color:${props => props.fontColor};
        };

    };

`
